import React from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2'
class ChartGenerator extends React.Component{

    state={
        clinicalData:[]
    }
    
    
    

    

    componentDidMount(){

        axios.get("http://localhost:8080/clinicalservices/api/clinicals/"+this.props.match.params.patientId+"/"+this.props.match.params.componentName).then(res=>{

            this.setState({ clinicalData: res.data });
        })

    }
    render(){
        function LineChart(){

            const data = {

                labes:['Jan','Feb','Mar','Apr','May'],
                dataSets:[
                    {
                        labe: 'Sales for 2020(M)',
                        data:[3, 2, 2, 1, 5]

                    }
                ]
            }
            return(
                <Line data={data}/>
            )

        }
       
        return 
        (
        <div>         
            <div className='chart'>
            <LineChart/>
            </div>
        </div>);
    }
}



export default ChartGenerator;
